 <img src="https://themify.me/demo/themes/ultra/files/2016/09/ipad-1-400x796.png" width="400" alt="ipad 1" srcset="https://themify.me/demo/themes/ultra/files/2016/09/ipad-1.png 400w, https://themify.me/demo/themes/ultra/files/2016/09/ipad-1-87x174.png 87w, https://themify.me/demo/themes/ultra/files/2016/09/ipad-1-151x300.png 151w, https://themify.me/demo/themes/ultra/files/2016/09/ipad-1-186x370.png 186w, https://themify.me/demo/themes/ultra/files/2016/09/ipad-1-302x600.png 302w" sizes="(max-width: 400px) 100vw, 400px" /> 
